import { Routes, Route, Outlet } from "react-router-dom";

import Home from "./routes/home/home.components.jsx";

const Navigation = () => {
  return (
    <div>
      <div>
        <h1>Navbar</h1>
      </div>
      <Outlet />
    </div>
  );
};

const App = () => {
  return (
    <Routes>
      <Route path="/" element={<Navigation />}>
        <Route path="/" element={<Home />} />
      </Route>
    </Routes>
  );
};

export default App;
